import React, { useContext, useState, useEffect } from "react";
import { AccountContext } from "../Authentication/Account";
import { Row, Col, Container, Jumbotron, Button } from "react-bootstrap";
import Tabletop from "tabletop";

const LatestAttendance = () => {
  const { userEmail } = useContext(AccountContext);
  const [data, setData] = useState([]);

  //.then((data) => setData(data))
  //.catch((err) => console.warn(err));

  const getdata = () => {
    var table = Tabletop.init({
      key:
        "https://docs.google.com/spreadsheets/d/1mPbAIEBiixpfc73FiHcqZVYRaIeV_onnt2qIzBGqViQ/edit?usp=sharing",
      simpleSheet: true,
    })
      .then((data) => setData(data))
      .catch((err) => console.warn(err));

    console.log(table.data());
  };

  useEffect(() => {
    getdata();
  }, []);

  //console.log(data);

  return (
    <>
      <Container className="latest-attendance text-center" fluid>
        <h3 style={{ color: "white", textAlign: "left" }}>Latest Attendance</h3>
        <Row>
          <Col>
            <Jumbotron
              style={{
                backgroundColor: "white",
                width: "auto",
                height: "auto",
              }}
            >
              <h3>CE-D21</h3>
              <Button>19 / 24</Button>
            </Jumbotron>
          </Col>
          <Col>
            <Jumbotron
              style={{
                backgroundColor: "white",
                width: "auto",
                height: "auto",
              }}
            >
              <h3>CE-D21</h3>
              <Button>19 / 24</Button>
            </Jumbotron>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default LatestAttendance;
